import {} from "./Buscar";


import './pokemon.css';
import PokemonCard from "./PokemonCard";


export function PokemonGrid(){
    const dispatch =useDispatch()
    const pok=dispatch(getPokemoN())
    const pokemones=useSelector(store =>store.pokemon.pokemons)

   console.log(pokemones)
    
    
   

    return(
        <div className="box">   
           
            <ul className="box">
                {
                    pokemones.map((i) => <PokemonCard key={i.id}
                    src={i.image} 
                    name={i.name}
                    tipo={i.tipo}
                    image={i.imag}/> )
                            
                }
            </ul>
        </div>
    );
};
